const Notes = () => {
  return (
    <div>
      <h2 className="text-2xl font-bold">Your Notes</h2>
      <p className="mt-4">Here you can view all your notes. Click on "New Note" to create a new note.</p>
      {/* Implementasikan logika untuk menampilkan dan menambah catatan di sini */}
    </div>
  );
};

export default Notes;
